import './Card.css';
import Todo from './Todo';
import Data from  './Data.json';


function Card() {
    
    const items= [];
    for(let x = 0; x < x.length;x++){
      items.push(  <Todo title={Data[0].title} desc={Data[0].desc} />)
    }
  

  return (
    <div className="container">
      <Todo title={Data[0].title} desc={Data[0].desc} />
      <Todo title={Data[1].title} desc={Data[1].desc} />
      <Todo title={Data[2].title} desc={Data[2].desc} />

  </div>
  )
}

export default Card
